  font-family: "Oswald", Georgia, "Times New Roman", Times, serif;
}

table,
th,
td {
  border: 1px solid #ff4838;
  color: white;
  font-family: "Oswald", Georgia, "Times New Roman", Times, serif;
  font-size: 85%;
}

table {
  margin: 5% 0% 5% 0%;
  width: 100%;
}

h2 {
  font-family: "Damion", Georgia, "Times New Roman", Times, serif;
  font-style: normal;
  font-weight: 550;
  color: white;
  font-size: 150%;
  text-align: center;
  border: 3px solid #ff4838;
}

h3 {
  font-family: "Damion", Georgia, "Times New Roman", Times, serif;
  font-style: normal;
  font-weight: 550;
  color: white;
  font-size: 100%;
